class SJHV{constructor(values){this.values=typeof values=="object"?values:{}};updateHTML(){var sjhvElements=document.querySelectorAll("[data-sjhv]");for(var i=0;i<sjhvElements.length;i++){this.exec(sjhvElements[i])}};updateChildren(n){if(n.hasAttribute('data-sjhv')){this.exec(n)};var sjhvElements=n.querySelectorAll(":scope [data-sjhv]");for(var i=0;i<n.length;i++){this.exec(sjhvElements[i])}};updateAll(n){for(var i=0;i<n.length;i++){this.exec(n[i])}};updateOnly(n){this.exec(n)};exec(e){let entries=Object.entries(JSON.parse(e.dataset.sjhv));let entrieslen=entries.length;for(let i=0;i<entrieslen;i++){let property=entries[i];e[property[0]]=this.values[property[1]]}};values={}}